import React, { Component } from'react';

const Child = props => (

        <ul>
            {this.props.items.map((item, index) => (
              <li key={index}>
                {item.text}
                <button value={index} onClick={props.remove.bind(null, item.id)}>x</button>
              </li>
            ))}
        </ul>
    );

export default Child;
